				</view>
				<view class="allowwithdrawal">
					<view>可提现</view>
				</view>
				<view class="allowdrawalnum">
					<view>￥<span>{{wallet - limit_money < 0?0:wallet - limit_money}}</span></view>
				</view>
				<view class="walletnum">
					<view class="jine">{{wallet}}</view>
					<view class="desc">钱包余额</view>
				</view>
				<view class="baozhengjin">
					<view class="jine">{{limit_money}}</view>
					<view class="desc">保证金</view>
				</view>
			</view>
			<view class="bankcard" @tap="bankcard()">
				<image src='../../static/images/paihang.png'></image>
				<view class="phb">
					银行卡列表
				</view>
			</view>
		</view>
		<view class="inputbox">
			<view class="input">
				<view class="entry">
					<view>提现金额</view>
				</view>
				<input class="moneyinput" type="digit" v-model="money" placeholder="请输入提现金额" placeholder-style="font-size: 36rpx;color: #999999;"/>
			</view>
			<view class="input" v-for="(item,index) in banklist" :key="index">
				<view class="entrys">
					<image src="../../static/icon/myicon2.png"></image>
					<view class="bank">{{item.bank}}</view>
					<view class="idnum">**** **** **** {{item.cardno}}</view>
					<view class="cardw">
						<image @tap="agreementSuccess(item.id)" class="fix"
							:src="item.id == cardid?'http://hlstore.yimetal.cn/2021/tuochebang/Oval@2x.png':'http://hlstore.yimetal.cn/2021/tuochebang/Oval@2x(1).png'"></image>
					</view>
				</view>
			</view>
		</view>
		<view class="btn" @tap="pay()">立即提现</view>
		<view>
			<text lines="1" class="paragraph">提现小于{{set[0].max}}元（不含2万元），每笔{{set[0].fee}}元；
				<br/>提现大于{{set[0].max}}元小于{{set[1].max}}元（不含{{set[1].max}}元），每笔{{set[1].fee}}元；
				<br/>提现大于{{set[1].max}}元，每笔{{set[2].fee}}元。
			</text>
		</view>
		<view class="ankuang" v-if="show">
			<view class="zhiwbox">
				<view class="titv">提示</view>
				<view class="titc">请输入支付密码</view>
				<view class="inp">
					<!-- <input class="shumi" password="true" type="number" maxlength="1" v-for="(item,index) in six" 
					:focus="index == jiao" @input="shu" hold-keyboard="true" confirm-hold="true"/> -->
					<input class="shumi" password="true" type="number" maxlength="6" @input="paypwd" cursor='0'/>
				</view>
				<image src="http://hlstore.yimetal.cn/2021/tuochebang/null.png" class="close" @click="guan"></image>
			</view>
			
		</view>
	</view>
	
</template>

<script>
	export default{
		data(){
			return{
				name:uni.getStorageSync('userInfo').nickname,
				wallet:uni.getStorageSync('userInfo').wallet,
				limit_money:'',
				set:[],
				banklist:[],
				cardid:'',
				money:'',
				show:false
			}
		},
		onLoad() {
			
		},
		onShow() {
			let that = this
			this.http.ajax({
				url: 'withDraw/withdrawSet',
				method: 'GET',
				data: {},
				success(res) {
					console.log(res)
					that.limit_money = res.data.limit_money
					that.set = res.data.set
				}
			});
			this.http.ajax({
				url: 'bank/list',
				method: 'GET',
				data: {
					user_id:uni.getStorageSync('userInfo').id
				},
				success(res) {
					that.banklist = res.data
				}
			});
		},
		methods:{
			guan(){
				this.show = !this.show
			},
			paypwd(e){
				let that = this
				if(e.target.value.length == 6){
					this.http.ajax({
						url: 'withDraw/withdraw',
						method: 'GET',
						data: {
							user_id:uni.getStorageSync('userInfo').id,
							money:this.money,
							type:2,
							pay_password:e.target.value,
							bank_id:this.cardid
						},
						success(res) {
							if(res.code == 200){
								uni.showToast({
									title:'提现成功',
									duration:1000
								})
								that.show = !that.show
								setTimeout(function(){
									uni.switchTab({
										url:'index'
									})
								},1000)
							}else if(res.code == -1){
								uni.showToast({
									title:res.message,
									icon:'none'
								})
							}
						}
					});
				}
			},
			// shu(e){
			// 	this.six[this.jiao] = e.target.value
			// 	this.jiao++
			// },
			pay(){
				if(!this.money){
					uni.showToast({
						title:'请输入提现金额',
						icon:'none'
					})
					return
				}
				if(!this.cardid){
					uni.showToast({
						title:'选择提现银行卡',
						icon:'none'
					})
					return
				}
				this.show = !this.show
			},
			onInput() {
				this.isFocus = true;
			},
			setInput(e) {
				this.input_val = e.detail.value;
				if (this.input_val.length == 6) {
					uni.navigateTo({
						url: "../index/index"
					})
				}
			},
			blurInput() {
				this.isFocus = false;
			},
			agreementSuccess(id){
				this.cardid = id
			},
			bankcard(){
				uni.navigateTo({
					url:'./bankcardlist'
				})
			}
		}
	}
	
</script>
